import React from "react";

export default function TodoItem({ description, todo, todos, setToDos }) {
  return (
    <div className="todo-item">
      <li>
        {description}
        <input type="checkbox" checked={todo.completed}/>
        <button>Delete</button>
      </li>
    </div>
  );
}
